contracts/Market.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

interface IERC20 {
    function transferFrom(address sender, address recipient, uint amount) external returns (bool);
    function transfer(address recipient, uint amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function approve(address spender, uint value) external returns (bool);
}

contract Market{
    event SubmitTransaction(
        address indexed owner,
        uint indexed txIndex,
        bytes data
    );
    event ConfirmTransaction(address indexed owner, uint indexed txIndex);
    event ExecuteTransaction(address indexed owner, uint indexed txIndex);
    event RevokeConfirmation(address indexed owner, uint indexed txIndex);

    struct Transaction {
        bytes data;
        bool executed;
        bool mulit;
    }

    modifier OnlyAdmin() {
        require(isAdministrator[msg.sender], "Only the administrator can use");
        _;
    }

    struct MyProduct {
        uint id;
        uint price;
        bool status;
    }

    uint256 private numConfirmationsRequired;
    uint private productID = 0;
    bool private sendToOwner = false;

    address private owner;
    address[] private administrators;
    Transaction[] private transactions;

    mapping(address => bool) private isAdministrator;
    mapping(uint => uint) private numConfirmations;
    mapping(uint => mapping(address => bool)) private isConfirmed;
    mapping(uint => mapping(uint => bool)) private products;
    MyProduct[] private myProducts;

    IERC20 private usdt;

    // constructor(address _usdt, address _owner, address[] memory _admin) {
    constructor(address[] memory _admin) {
        owner = msg.sender;
        usdt = IERC20(0x8B801270f3e02eA2AACCf134333D5E5A019eFf42);
        numConfirmationsRequired = _admin.length;
        for (uint8 index = 0; index < numConfirmationsRequired; index++) {
            if (!isAdministrator[_admin[index]]) {
                administrators.push(_admin[index]);
                isAdministrator[_admin[index]] = true;
            }
        }
    }

    function getOwner() public OnlyAdmin view returns (address) {
        return owner;
    }

    function getAdministrator() public OnlyAdmin view returns (address[] memory) {
        return administrators;
    }

    function getNumConfirmationsRequired() public OnlyAdmin view returns (uint256) {
        return numConfirmationsRequired;
    }

    function getTransactions() public OnlyAdmin view returns (Transaction[] memory) {
        return transactions;
    }

    function getSendSwitch() public OnlyAdmin view returns (bool) {
        return sendToOwner;
    }

    function getUSDT() public view returns (uint256) {
        uint256 _usdt = usdt.balanceOf(msg.sender);
        return  _usdt;
    }

    function usdtApprove(uint256 _core, uint256 _days) public returns (uint) {
        // 计算金额
        uint cost;
        if (_days == 30) {
            cost = _core * _days * 6 * 15 * 10 ** 3;
        } else if (_days == 60) {
            cost = _core * _days * 6 * 13 * 10 ** 3;
        } else if (_days == 90) {
            cost = _core * _days * 6 * 125 * 10 ** 2;
        } else {
            require(false, "Invalid days, must be 30, 60 or 90");
        }
        // 授权金额
        bool success = usdt.approve(msg.sender, cost);
        require(success, "USDT approve failed");
        return cost;
    }

    // 接收并转发usdt到合约所有者
    function usdtReceive(uint _cost) external {
        // 发起转账
        bool transfer = usdt.transferFrom(msg.sender, address(this), _cost);
        require(transfer, "USDT transfer failed");

        // 将代币发送到合约所有者的地址
        if (sendToOwner) {
            usdt.transfer(owner, _cost);
        }
    }

    // 设置最小确认数
    function setConfirmationsRequired(uint256 _value) internal {
        require(((_value >= 1)&&(_value <= administrators.length)), "required number must >= 1 or <= controller member.");
        numConfirmationsRequired = _value;
    }

    // 提交设置最小确认数提案
    function commitSetConfirmationsRequired(uint256 _value) external OnlyAdmin {
        submitTransaction(
            transactions,
            abi.encodeWithSignature("setConfirmationsRequired(uint256)", _value),
            true
        );
    }

    // 合约拥有者设置 (调用出错)
    function setOwner(address _newOwner) internal {
        owner = _newOwner;
    }

    // 自动发送到owner钱包开关
    function sendSwitch() external OnlyAdmin {
        sendToOwner = !sendToOwner;
    }

    // 提交设置拥有者提案
    function commitSetOwner(address _newOwner) external OnlyAdmin returns (uint) {
        submitTransaction(
            transactions,
            // address(this),
            abi.encodeWithSignature("setOwner(address)", _newOwner),
            true
        );
        return transactions.length;
    }

    // 确认提案
    function confirmTransaction(uint _txIndex) external OnlyAdmin {
        confirmTransaction(
            transactions, 
            isConfirmed, 
            numConfirmations, 
            numConfirmationsRequired,
            _txIndex
        );
    }

    // 拒绝提案
    function revokeConfirmation(uint _txIndex) external OnlyAdmin {
        revokeConfirmation(
            transactions, 
            isConfirmed, 
            numConfirmations, 
            _txIndex
        );
    }

    // 手动提款
    function usdtWithdraw() external OnlyAdmin {
        uint256 balance = usdt.balanceOf(address(this));
        usdt.transfer(owner, balance);
    }

    // 提交多签消息
    // function submitTransaction(Transaction[] storage _transactions, address _to, bytes memory _data, bool _mulit) internal {
    function submitTransaction(Transaction[] storage _transactions, bytes memory _data, bool _mulit) internal {
        _transactions.push(Transaction({
            data: _data,
            executed: false,
            mulit: _mulit
        }));

        emit SubmitTransaction(msg.sender, _transactions.length, _data);
    }

    // 确认消息
    function confirmTransaction(
        Transaction[] storage _transactions,
        mapping(uint => mapping(address => bool)) storage _isConfirmed,
        mapping(uint => uint) storage _numConfirmations,
        uint _numConfirmationsRequired,
        uint _txIndex
    ) internal {
        require(!_isConfirmed[_txIndex][msg.sender], "Transaction already confirmed");

        _isConfirmed[_txIndex][msg.sender] = true;
        _numConfirmations[_txIndex]++;

        emit ConfirmTransaction(msg.sender, _txIndex);

        if (_numConfirmations[_txIndex] >= _numConfirmationsRequired) {
            executeTransaction(_transactions, _txIndex);
        }
    }

    // 执行消息
    function executeTransaction(Transaction[] storage _transactions, uint _txIndex) internal {
        require(_txIndex < _transactions.length, "Invalid transaction index");
        require(!_transactions[_txIndex].executed, "Transaction already executed");

        Transaction storage transaction = _transactions[_txIndex];
        transaction.executed = true;

        // (bool success, ) = transaction.to.call(transaction.data);
        (bool success, ) = address(this).call(transaction.data);
        require(success, "Transaction execution failed");
        emit ExecuteTransaction(msg.sender, _txIndex);
    }

    // 拒绝提案
    function revokeConfirmation(
        Transaction[] storage _transactions,
        mapping(uint => mapping(address => bool)) storage _isConfirmed,
        mapping(uint => uint) storage _numConfirmations,
        uint _txIndex
    ) internal {
        require(_txIndex < _transactions.length, "Invalid transaction index");
        require(_transactions[_txIndex].executed, "Transaction not executed");

        require(_isConfirmed[_txIndex][msg.sender], "Transaction not confirmed");

        _isConfirmed[_txIndex][msg.sender] = false;
        _numConfirmations[_txIndex]--;

        emit RevokeConfirmation(msg.sender, _txIndex);
    }
}

